import React from "react";
import { FILE_TYPE } from "../constants";
import { Document, Page } from 'react-pdf'

const me1 = require("../assets/pictures/background.jpg");
const resume = require("../assets/files/JustinMa.pdf");

const ME = [
  {
    id: "me_text",
    size: { x: 400, y: 200 },
    pos: { x: 200, y: 100 },
    title: "About_Me.txt",
    type: FILE_TYPE.TEXT,
    content: (
      <div className={FILE_TYPE.TEXT}>
        <h1>About me...</h1>
      </div>
    )
  },
  {
    id: "me_pic1",
    pos: { x: 250, y: 150 },
    title: "IMG_0617.jpg",
    type: FILE_TYPE.PICTURE,
    source: me1,
    content: <img className={FILE_TYPE.PICTURE} alt="me_pic1" src={me1} />
  },
  {
    id: "me_resume",
    pos: { x: 250, y: 150 },
    title: "IMG_0617.jpg",
    type: FILE_TYPE.PICTURE,
    source: me1,
    content: <Document className={FILE_TYPE.PICTURE} file={resume} >
      <Page pageNumber={1}></Page>
    </Document>
  }
];

export default ME;
